description:
Rancher Dan Evans heads into Bisbee to clear up issues concerning the sake of his land when he witnesses the closing events of a stagecoach robbery lead by famed outlaw Ben Wade. No sooner or later, Wade is captured by the law in Bisbee and Evans finds himself one of the escorts who will take Wade to the 3:10 to Yuma train in Contention for the reward of $200. Evans quest for taking Wade to the station is not only for saving for his land but an inner battle that he can be more than just a naive rancher in the eyes of his impetuous and gunslinging son William Evans. The transport to Contention is hazardous and filled with ambushes from Indians, pursuits by Wade\\\\\\\&amp;#039;s vengeful gang and Wade\\\\\\\&amp;#039;s own conniving and surreptitious demeanor that makes the ride all more intense.
